import { NavLink, Outlet } from 'react-router-dom'


const setActive = ({isActive}) => isActive ? 'active-link' : '';

function Layout() {
    return (
        <>
    <header>
        <div>
          <NavLink to="/" className={setActive}>Home</NavLink>
          <NavLink to="/login" className={setActive}>LoginPage</NavLink>
        </div>
    </header>
    <Outlet />
    </>
    );
  }
  
  export {Layout};
